<h1 id="Spam">Spam<a class="anchor-link" href="#Spam">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the 'Spam' dataset to catch SMS spams. You can download the Jupyter Notebook of the study by clicking <a href="spam.ipynb">here</a>. Click <a href="../../data/spam.csv">here</a> to download the dataset</p>
<p>We have access to the following data:</p>
<ul class="ul_content">
    <li><b>v1: </b> the SMS type (spam or ham)</li>
    <li><b>v2: </b> SMS content</li>
</ul><p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this use-case. The purpose is to show you some of the library interesting functionalities.</p>
<h2 id="Initialization">Initialization<a class="anchor-link" href="#Initialization">&#182;</a></h2><p>Let's create the Virtual DataFrame of the dataset.</p>

