id white;">ham</td><td style="border: 1px solid white;">&lt;#&gt;  great loxahatchee xmas tree burning update: you can totally see stars here</td></tr><tr><td style="border-top: 1px solid white;background-color:#214579;color:white"></td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td></tr></table>
