<h2 id="Data-Exploration-and-Preparation">Data Exploration and Preparation<a class="anchor-link" href="#Data-Exploration-and-Preparation">&#182;</a></h2><p>As the dataset study resides on Text Analytic. We need to create some features in order to compute some statistics. We can for example, compute the SMS length and use a label encoding on the 'type' to get a dummy (1 if the message is a SPAM, 0 otherwise). It is also judicious to convert the Message content to Lowercase (it will make the study easier).</p>

</div>
