<div class=" highlight hl-ipython3"><pre><span></span><span class="n">spam</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="s2">&quot;length&quot;</span><span class="p">,</span> <span class="s2">&quot;LENGTH(content)&quot;</span><span class="p">)</span>
