<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that the SPAM are much longer than regular message ! Let's use the CountVectorizer to create a Dictionary and identify keywords. But let's first create a view with only the Spams.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[4]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">drop_view</span><span class="p">(</span><span class="s2">&quot;spams&quot;</span><span class="p">)</span>
<span class="n">spam</span><span class="o">.</span><span class="n">to_db</span><span class="p">(</span><span class="s2">&quot;spams&quot;</span><span class="p">,</span> <span class="n">db_filter</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;type = 1&quot;</span><span class="p">])</span>

<span class="kn">from</span> <span class="nn">vertica_ml_python.learn.preprocessing</span> <span class="k">import</span> <span class="n">CountVectorizer</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python.utilities</span> <span class="k">import</span> <span class="n">drop_text_index</span>
<span class="n">drop_text_index</span><span class="p">(</span><span class="s2">&quot;spams_voc&quot;</span><span class="p">)</span>
<span class="n">dict_spams</span> <span class="o">=</span> <span class="n">CountVectorizer</span><span class="p">(</span><span class="s2">&quot;spams_voc&quot;</span><span class="p">)</span>
<span class="n">dict_spams</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="s2">&quot;spams&quot;</span><span class="p">,</span> <span class="p">[</span><span class="s2">&quot;content&quot;</span><span class="p">])</span>
<span class="n">dict_spams</span> <span class="o">=</span> <span class="n">dict_spams</span><span class="o">.</span><span class="n">to_vdf</span><span class="p">()</span>
<span class="nb">print</span><span class="p">(</span><span class="n">dict_spams</span><span class="p">)</span>
</pre></div>

