    <span class="n">spam</span><span class="o">.</span><span class="n">regexp</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="n">elem</span><span class="p">,</span>
                <span class="n">pattern</span> <span class="o">=</span> <span class="n">elem</span><span class="p">,</span>
                <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;count&quot;</span><span class="p">,</span>
                <span class="n">column</span> <span class="o">=</span> <span class="s2">&quot;content&quot;</span><span class="p">)</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">spam</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">focus</span> <span class="o">=</span> <span class="s2">&quot;type&quot;</span><span class="p">)</span>
