<div class="text_cell_render border-box-sizing rendered_html">
<p>Naive Bayes is a Powerful and Performant Algorithm for Text Analytics Binary Classification use cases. That's why we will choose it to do the prediction. Before learning on all the data, let's first use a Cross Validation to test our model efficiency.</p>

