<span class="n">model</span><span class="o">.</span><span class="n">drop</span><span class="p">()</span>

<span class="kn">from</span> <span class="nn">vertica_ml_python.learn.model_selection</span> <span class="k">import</span> <span class="n">cross_validate</span>
<span class="n">cross_validate</span><span class="p">(</span><span class="n">model</span><span class="p">,</span> 
               <span class="s2">&quot;spam_clean&quot;</span><span class="p">,</span> 
               <span class="n">spam</span><span class="o">.</span><span class="n">get_columns</span><span class="p">(</span><span class="n">exclude_columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;type&quot;</span><span class="p">,</span> <span class="s2">&quot;content&quot;</span><span class="p">]),</span> 
               <span class="s2">&quot;type&quot;</span><span class="p">,</span> 
